import React from 'react';

function Footer() {
  return (
    <footer role="contentinfo" className="footer-wrapper" aria-label="Copyright Information">
      <div className="center footer">
        All copyrights reserved &copy; Bharath Raj Patalay
      </div>
    </footer>
  );
}

export default Footer;
